import React from 'react';
import './style.css'




function Menu() {
    return (


        <div class="menu">

            <div class="container">

                <ul>
                    <li>Home</li>
                    <li>Games </li>
                    <li> Consoles </li>
                    <li> Playstation </li>
                    <li> Xbox </li>
                    <li> Nintendo </li>
                    <li> PC </li>
                </ul>

            </div>

        </div>



    );
}

export default Menu;
